<html>
<head>
<script src="http://code.jquery.com/jquery-1.10.1.min.js"></script>
<script src="FileSaver.js"></script>
<script type="text/javascript">
var bintohex = function (binaryString)
{
    var output = '';

    // For every 4 bits in the binary string
    for (var i=0; i < binaryString.length; i+=4)
    {
        // Grab a chunk of 4 bits
        var bytes = binaryString.substr(i, 4);

        // Convert to decimal then hexadecimal
        var decimal = parseInt(bytes, 2);
        var hex = decimal.toString(16);

        // Uppercase all the letters and append to output
        output += hex.toUpperCase();
    }

    return output;      
}
$(function () {
    $('body').on('click', 'td', function () {
        $(this).toggleClass('selected');
    });

    $('button').click(function (e) {
        e.preventDefault();
        var cells = $('td');
        var data = [];

        var i, j;
        var line;
        for (i = 0; i < cells.length; i = i + 8) {
            line = []
            for (j = 0; j < 8; j++) {
                line[j] = $(cells[i+j]).hasClass('selected') ? "1" : "0";
            }
            console.log(line.join(''));
            data.push(bintohex(line.join('')) + "\n")
        }

        var blob = new Blob(data);
        saveAs(blob, "configuration.mem");
    });
});
</script>
<style type="text/css">
body, table, td, .cell {
    margin: 0;
    padding: 0;
}
    
table {
    display: block;
    border-collapse: collapse;
    overflow: scroll;
    width: auto;
}
td {
    border: 1px solid black;
}
.cell {
    min-width: 5px;
    min-height: 5px;
}

.cell:hover, .selected {
    background-color: blue;
   }
</style>
